import { Box } from "@mui/material";
import React from "react";

function Footer() {
  return (
    <Box
      sx={{
        backgroundImage: "linear-gradient(45deg, #3593B0 0%, #4A9B85 100%)",
        maxWidth: "120%",
        margin: "0 auto",
        padding: 0,
        height: "600px",
        backgroundColor: "#EAF7FA;",
        marginTop: "100px",
      }}
    ></Box>
  );
}

export default Footer;
